import React, { Component } from 'react';
import NavBar from "./NavBar"
class HomePage extends Component {
    render() {
        return (

            <div className="container">
                <NavBar/>

                <div className="row">
                    <div className="col-md-3 bg-warning">left</div>
                    <div className="col-md-6 bg-info">Center</div>
                    <div className="col-md-3 bg-danger">Right </div>
                </div>
            </div>


        );
    }
}

export default HomePage;
